import { Button } from "@mui/material";
import { title } from "process";
import { FC } from "react";

interface Props{
    text:string    
    ColorFondo:string,
    CornerRadius:number,
    fontColor:string,
    flexNumber:number,
    hover:string,
    fontFamily:string
}

const MyButton:FC<Props> = ({text,ColorFondo,CornerRadius,fontColor,flexNumber,hover,fontFamily}) =>{
    return (
        <Button
            sx={{
                backgroundColor: ColorFondo,    // Color de fondo inicial
                borderRadius: CornerRadius,
                color: fontColor,
                flex: flexNumber,
                textTransform:'none',
                '&:hover': {
                backgroundColor: hover,  // Color de fondo al hacer hover
                },                
            }}
        >
            {text}
        </Button>
    );
}

export default MyButton
